#include <iostream>
#include <string>
using namespace std;

int main() {
    string s;
    int count = 0;

    cin >> s;

    // Check if all characters are lowercase
    for (int i = 0; i < s.length(); i++) {
        if (s[i] < 'a' || s[i] > 'z') {
            cout << "Invalid" << endl;
            return 0;
        }
    }

    // Count vowels
    for (int i = 0; i < s.length(); i++) {
        char c = s[i];
        if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u') {
            count++;
        }
    }

    cout << count << endl;
    return 0;
}

